// src/components/SearchList.js

import React from 'react';
import Menus from "/component/Menus";

function SearchList({ menu}) {
  const filtered = menu.map(menu=>  <Menus key={menu.id} person={menu} />); 
  return (
    <div>
      {filtered}
    </div>
  );
}

export default SearchList
